from collections import dequeclass Stack:    def __init__(self):        self.items = deque()    def is_empty(self):        if not self.items:            return True        else:            return False    def push(self, item):        self.items.append(item)    def pop(self):        if not self.is_empty():            return self.items.pop()        else:            return 'stack is empty'    def peek(self):        if not self.is_empty():            return self.items[-1]        else:            return 'stack is empty'